import React, { useState, useEffect } from "react";

const NewBlogForm = ({ loginStatus }) => {
  return (
    <form>
      <h2>Add a new blog</h2>
      <div>
        title
        <input type="text" />
      </div>
      <div>
        author
        <input type="text" />
      </div>
      <div>
        url
        <input type="text" />
      </div>
      <div>
        likes
        <input type="number" />
      </div>
    </form>
  );
};

export default NewBlogForm;
